 3. L’insicurezza può fermentare

 Se non sei consapevole del tuo valore, nessuno può aiutarti in questo.  Sta a te vedere cosa hai.  Sta a te sapere che potresti avere delle imperfezioni, ma che non è la definizione di chi sei.

 I tuoi difetti sono solo un’altra caratteristica.  Non hanno lo scopo di sminuirti.  La tua forza deriva dalla tua unicità nella vita.

 Segui il percorso che è tuo.  Non competere o confrontarti.  Sii te stesso.  Fai un elenco non solo di quello che hai, ma anche di quello che vorresti che qualcuno ti dicesse.

 Ad esempio, usa affermazioni positive:

 Io sono degno.
 Sono imperfettamente perfetto.
 Sono pieno di meraviglia e gioia.
 So chi sono.

